  [],\n\t\"revision_timestamp\": \"2015-05-26T23:12:35.184200\",\n\t\"name\": \"raw-data-for-u-s-department-of-energy-doe-categorical-exclusioncx-determinations-under-the\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"To further transparency and openness, DOE
  established a policy to document and post online all CX determinations involving
  classes of actions listed in Appendix B to Subpart D of the DOE NEPA regulations
  (10 CFR Part 1021).  This raw data set contains CX determinations required to be
  posted under the policy, and also some for which documentation and posting are optional,
  i.e., determinations involving classes of actions listed in Appendix A or made before
  the policy's effective date of November 2, 2009.  The data set includes information
  by state, CX applied, date range, DOE Program, Field, or Site Office, keyword, and
  whether the CX determination is for a project related to the American Recovery and
  Reinvestment Act (Recovery Act or ARRA) of 2009.  The web address to the CX determination
  documents are provided.  This data set will be updated approximately monthly.  See
  www.gc.doe.gov/NEPA/categorical_exclusion_determinations.htm for information on
  DOE CX procedures. For further information on DOE's NEPA compliance program, see
  www.gc.energy.gov/nepa or  email:  askNEPA@hq.doe.gov.\",\n\t\"license_title\":
